import React, { Component } from 'react';

class Links extends Component {
  render() {

    return(
    <div className="animated fadeIn">
      <LinkButtons/>
    </div>
    )
  }
}

class LinkButtons extends Component {


  render() {
    const linkbtns = [
      {name: 'HS Comic Maker', style: 'hscm', url: 'url'},
      {name: 'HS JPN/KOR study discord', style: 'hslang', url: 'url'},
      {name: 'Hiveswap Quirk Converter', style: 'hsqc', url: 'url'}
    ]

    return(
      <div>
      { linkbtns.map((el, i) => {
        return(
          <LinkButton
            key={ i }
            name={el.name}
            style={el.style}
          />
        )
      })
      }
      </div>
    )
  }
}

class LinkButton extends Component {
  render() {
    const divStyle={
        BackgroundImage: url(`/images/{this.props.style}`)
      }
    return(
      <React.Fragment>
        <button className={this.props.style}
>
          {this.props.name}
        </button>
          <br />
      </ React.Fragment>
    )
  }
}


export default Links;
